const a={a1:"滑块控件允许用户通过移动滑块从一系列的值中进行选择。",a2:"滑块是用于调整反映强度级别（如音量、亮度或色彩饱和度）的设置的理想组件。",a3:"滑块可以在滑动条的两端有反映强度值的图标。将滑块范围的最小值放在左侧，最大值放在右侧。",a4:"连续滑块",a5:"连续滑块允许用户在主观范围内选择一个值。它们不需要特定的值来进行调整，尽管在某些情况下，它们可以提供可编辑的数值。",a6:"间续滑块",a7:"间续滑块允许用户从一个范围中选择特定值。",a8:"连续滑块",a9:"间续滑块",a10:"在不要求精准、以主观感觉为主的设置中使用连续滑块，让使用者做出更有意义的调整。",a11:"亮色主题",a12:"打开时的滑块：Swatch 500，不透明度 100%<br />打开时的轨道：Swatch 500，不透明度 100%",a13:"关闭时的滑块：#000000，不透明度 26%<br />关闭时的轨道：#000000，不透明度 26%",a14:"关闭时聚焦和点击状态的滑块：#000000，不透明度 38% <br />关闭时聚焦和点击时的轨道：#000000，不透明度 38%",a15:"禁用状态（不相连）：#000000，不透明度 26%",a16:"亮色主题",a17:"暗色主题",a18:"打开时的滑块：Swatch 200，不透明度 100%<br />打开时的轨道：Swatch 200，不透明度 100%",a19:"关闭时的滑块：#FFFFFF，不透明度 30%<br />关闭时的轨道：#FFFFFF，不透明度 30%",a20:"禁用状态（不相连）：#FFFFFF，不透明度 30%",a21:"暗色主题",a22:"不同的滑块行为",a23:"图标与滑块栏左/右的间距：",a24:"滑块中图标的间距示例。",a25:"滑块在正常、鼠标悬停、聚焦、点击和禁用状态下的示例。",a26:"含可编辑的数值",a27:"用于需要设置精确值的设置项，通过点击滑块，文本框会变成可编辑状态以供输入文本，并且自动移动滑块来更新滑块的值。",a28:"具有可编辑数值的滑块示例",a29:"具有可编辑数值的滑块在正常、鼠标悬停、聚焦、点击和禁用状态下的示例。",a30:"间续滑块会恰好咬合到在滑动条上平均分布的间续标记上。在要求精准、以客观设定为主的设置项中使用间续滑块，让使用者做出更有意义的调整。应当对每个间续标记设定一定的等级区间进行分隔，使得其调整效果对于使用者来说显而易见。这些生成区间的值应当是预先设定好的，使用者不可对其进行编辑。",a31:"含数值标签",a32:"用于用户需要知道精确数值的设置项。",a33:"亮色主题",a34:"暗色主题",a35:"间续滑块的动画效果",a36:"Material Design 中的滑块控件用于选择值",a37:"Material Design 亮色主题的连续滑块",a38:"Material Design 暗色主题的连续滑块",a39:"Material Design 中滑块图标的间距示例",a40:"Material Design 中的滑块状态示例",a41:"Material Design 具有可编辑数值的滑块示例",a42:"Material Design 中可编辑的滑块在不同状态下的示例",a43:"Material Design 亮色主题的间续滑块",a44:"Material Design 暗色主题的间续滑块"};export{a as zhCn};
